import Link from "next/link";
import Navbar from "./comps/navbar";
import Footer from "./comps/footer";
import "../public/css/contact.scss";

const Contact = () => (
    <div className="contactMotherDiv">
        <Navbar/>
        <div className="mainDivContact">
            <div className="headContainer">
                <div className="insideHeadDiv">
                    <h2>Contact Me</h2>
                </div>
            </div>
            <div className="infoContainer">
                <div className="infoHeadDiv">Jacob Broughton</div>
                <div className="infoDiv">
                    <div className="contactInfoSide">
                        <div className="contactInfoDiv">
                            <p>(704)770-8371</p>
                            <p>Jlbroughtondev@gmail.com</p>
                            <p>Matthews, NC 28105</p>
                        </div>
                    </div>
                    <div className="socialInfoSide">social</div>
                </div>
            </div>
            <div className="formContainer">Form</div>
        </div>
        <Footer/>

        <style jsx global>{`
            body{
                margin: 0;
                cursor: default;
            } 
        `}
        </style>
    </div>
)

export default Contact;
